import React from 'react'
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import image1 from './slider/Group 3171.png';
import image2 from './slider/Group 3172 (1).png';
import image3 from './slider/Group 3173.png';
import image4 from './slider/Group 3174.png';
import image5 from './slider/Group 3175.png';
export default function Slider() {
  return (
    <div>
      <Carousel
   additionalTransfrom={0}
   arrows
   autoPlay
   autoPlaySpeed={2000}
   centerMode={false}
   className=""
   containerClass="container-with-dots"
   dotListClass=""
   draggable
   focusOnSelect={false}
   infinite
   itemClass=""
   keyBoardControl
   minimumTouchDrag={80}
   renderButtonGroupOutside={false}
   renderDotsOutside={false}
   responsive={{
      desktop: {
         breakpoint: {
            max: 3000,
            min: 1024
         },
         items: 5,
         paritialVisibilityGutter: 40
      },
      mobile: {
         breakpoint: {
            max: 464,
            min: 0
         },
         items: 1,
         paritialVisibilityGutter: 30
      },
      tablet: {
         breakpoint: {
            max: 1024,
            min: 464
         },
         items: 2,
         paritialVisibilityGutter: 30
      }
   }}
   showDots
   sliderClass=""
   slidesToSlide={1}
   swipeable
>
   <img src={image1} alt="image1" />
   <img src={image2} alt="image2" />
   <img src={image3} alt="image3" />
   <img src={image4} alt="image4" />
   <img src={image5} alt="image5" />
</Carousel>

    </div>
  )
}
